import { Component } from 'react'
import {Container,Col, Row} from 'react-bootstrap'
import SingleBook from './SingleBook'

class BookList extends Component {
    render(){
        return(
                <Container>
                        <Row>
                            {
                                props.books.map(b =>(
                                    <Col>
                                    <SingleBook book ={b} />
                                    </Col>
                                ))
                            } 

                        </Row>
                </Container>
        )
    }

}



export default BookList
